          </xsd:element>
          <xsd:element minOccurs="0" name="CAUSE">
            <xsd:annotation>
              <xsd:documentation>Código de causa.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="1"/>
                <xsd:maxLength value="30"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="SERVICE">
            <xsd:annotation>
              <xsd:documentation>Código de servicio</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="1"/>
                <xsd:maxLength value="30"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="BREAKDOWN">
            <xsd:annotation>
              <xsd:documentation>Código de avería</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="1"/>
                <xsd:maxLength value="30"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="COUNTRY1">
            <xsd:annotation>
              <xsd:documentation>Código de país de origen.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="2"/>
                <xsd:maxLength value="20"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="ZONE1">
            <xsd:annotation>
              <xsd:documentation>Zona origen.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="1"/>
                <xsd:maxLength value="1800"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="STREET">
            <xsd:annotation>
              <xsd:documentation>Calle.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="1"/>
                <xsd:maxLength value="300"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="LOCATION">
            <xsd:annotation>
              <xsd:documentation>Lugar de la asistencia.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="1"/>
                <xsd:maxLength value="600"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="COUNTRY2">
            <xsd:annotation>
              <xsd:documentation>Código de país destino.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="2"/>
                <xsd:maxLength value="20"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="ZONE2">
            <xsd:annotation>
              <xsd:documentation>Zona destino.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="1"/>
                <xsd:maxLength value="1800"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element maxOccurs="60" minOccurs="0" name="TELEPHONE" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Número de teléfono</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="DNI">
            <xsd:annotation>
              <xsd:documentation>Código de documento de identidad.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="1"/>
                <xsd:maxLength value="30"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="AMOUNT" type="xsd:decimal">
            <xsd:annotation>
              <xsd:documentation>Importe estimado.</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="SERVICE_DATE" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Fecha de planificación del servicio.</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="MSG_CLIENT">
            <xsd:annotation>
              <xsd:documentation>Mensaje del cliente.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="1"/>
                <xsd:maxLength value="30"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
        </xsd:sequence>
      </xsd:complexType>
      <xsd:complexType name="Cabecera">
        <xsd:annotation>
          <xsd:documentation>Objeto de negocio que representa datos
						claves de identificación de país, cliente y expediente ajeno (de
						cliente). Forman parte de los atributos fijos</xsd:documentation>
        </xsd:annotation>
        <xsd:sequence>
          <xsd:element minOccurs="0" name="AMA">
            <xsd:annotation>
              <xsd:documentation>Código ISO de país.

								Identifica a uno de los países donde está implantada la aplicación AMA.
								Puede tomar los siguientes valores:
								- AD (ANDORRA)
								- AE (EMIRATOS ARABES UNIDOS)
								- AL (ALBANIA)
								- AO (ANGOLA)
								- AR (ARGENTINA)
								- BA (BOSNIA Y HERZEGOVINA)
								- BE (BELGICA)
								- BG (BULGARIA)
								- BH (BAREIN)
								- BO (BOLIVIA)
								- BR (BRASIL)
								- CL (CHILE)
								- CN (REP. POPULAR CHINA)
								- CO (COLOMBIA)
								- CV (CABO VERDE)
								- CY (CHIPRE)
								- DO (REPUBLICA DOMINICANA)
								- EC (ECUADOR)
								- EG (EGIPTO)
								- EH (SAHARA OCCIDENTAL)
								- ES (ESPAÑA)
								- FK (ISLAS MALVINAS)
								- FR (FRANCIA)
								- GG (GUERNSEY)
								- GI (GIBRALTAR)
								- GR (GRECIA)
								- GS (ISLAS GEORGIAS DEL SUR Y SANDWICH DEL SUR)
								- GW (GUINEA-BISSAU)
								- HK (HONG KONG)
								- HR (CROACIA)
								- IE (IRLANDA)
								- IM (ISLA DE MAN)
								- IN (INDIA)
								- IQ (IRAK)
								- IR (IRAN)
								- IT (ITALIA)
								- JE (JERSEY)
								- JO (JORDANIA)
								- KW (KUWAIT)
								- LB (LIBANO)
								- LU (LUXEMBURGO)
								- MA (MARRUECOS)
								- MC (MONACO)
								- ME (MONTENEGRO)
								- MK (MACEDONIA)
								- MO (MACAO)
								- MT (MALTA)
								- MX (MEXICO)
								- MZ (MOZAMBIQUE)
								- OM (OMAN)
								- PE (PERU)
								- PH (FILIPINAS)
								- PT (PORTUGAL)
								- PY (PARAGUAY)
								- QA (QATAR)
								- RO (RUMANIA)
								- RS (SERBIA)
								- SA (ARABIA SAUDITA)
								- SD (SUDAN)
								- SH (SANTA HELENA, ASCENSION Y TRISTAN DE ACUÑA)
								- SI (ESLOVENIA)
								- SM (SAN MARINO)
								- SS (SUDAN DEL SUR)
								- ST (SANTO TOME Y PRINCIPE)
								- SY (SIRIA)
								- TR (TURQUIA)
								- UK (REINO UNIDO)
								- UY (URUGUAY)
								- VA (CIUDAD DEL VATICANO)
								- VE (VENEZUELA)
								- YE (YEMEN)</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:length value="2"/>
                <xsd:enumeration value="AD"/>
                <xsd:enumeration value="AE"/>
                <xsd:enumeration value="AL"/>
                <xsd:enumeration value="AO"/>
                <xsd:enumeration value="AR"/>
                <xsd:enumeration value="BA"/>
                <xsd:enumeration value="BE"/>
                <xsd:enumeration value="BG"/>
                <xsd:enumeration value="BH"/>
                <xsd:enumeration value="BO"/>
                <xsd:enumeration value="BR"/>
                <xsd:enumeration value="CL"/>
                <xsd:enumeration value="CN"/>
                <xsd:enumeration value="CO"/>
                <xsd:enumeration value="CV"/>
                <xsd:enumeration value="CY"/>
                <xsd:enumeration value="DO"/>
                <xsd:enumeration value="EC"/>
                <xsd:enumeration value="EG"/>
                <xsd:enumeration value="EH"/>
                <xsd:enumeration value="ES"/>
                <xsd:enumeration value="FK"/>
                <xsd:enumeration value="FR"/>
                <xsd:enumeration value="GG"/>
                <xsd:enumeration value="GI"/>
                <xsd:enumeration value="GR"/>
                <xsd:enumeration value="GS"/>
                <xsd:enumeration value="GW"/>
                <xsd:enumeration value="HK"/>
                <xsd:enumeration value="HR"/>
                <xsd:enumeration value="IE"/>
                <xsd:enumeration value="IM"/>
                <xsd:enumeration value="IN"/>
                <xsd:enumeration value="IQ"/>
                <xsd:enumeration value="IR"/>
                <xsd:enumeration value="IT"/>
                <xsd:enumeration value="JE"/>
                <xsd:enumeration value="JO"/>
                <xsd:enumeration value="KW"/>
                <xsd:enumeration value="LB"/>
                <xsd:enumeration value="LU"/>
                <xsd:enumeration value="MA"/>
                <xsd:enumeration value="MC"/>
                <xsd:enumeration value="ME"/>
                <xsd:enumeration value="MK"/>
                <xsd:enumeration value="MO"/>
                <xsd:enumeration value="MT"/>
                <xsd:enumeration value="MX"/>
                <xsd:enumeration value="MZ"/>
                <xsd:enumeration value="OM"/>
                <xsd:enumeration value="PE"/>
                <xsd:enumeration value="PH"/>
                <xsd:enumeration value="PT"/>
                <xsd:enumeration value="PY"/>
                <xsd:enumeration value="QA"/>
