            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="CLIENT">
            <xsd:annotation>
              <xsd:documentation>Identificación de cliente.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="0"/>
                <xsd:maxLength value="20"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="ID">
            <xsd:annotation>
              <xsd:documentation>Identificación de contrato.</xsd:documentation>
            </xsd:annotation>
