                <xsd:maxLength value="150"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
        </xsd:sequence>
      </xsd:complexType>
      <xsd:complexType name="AtributoVariable">
        <xsd:annotation>
          <xsd:documentation>Objeto de negocio que representa un
						parámetro variable que se utiliza para crear una asistencia. Estos
						parámetros variables son configurables y no están prefijados.

						Los “Atributos Variables” se configuran para un contrato AMA de un
						cliente de AMA para un determinado país, por lo que en función de
						lo que se haya definido para cada cliente, contrato e incluso país
						por determinados temas legales o locales, el tipo y número de
						atributos variables, será diferente en cada caso. No hay un
						criterio fijo de atributos variables por las dependencias con el
						tipo de contrato y porque la principal finalidad de estos
						atributos es particularizar las gestiones de una aplicación tan
						compleja como AMA Asistencia a los ámbitos particulares de un
						cliente, contrato o país. La aportación de los atributos variables
						en AMA se traduce en la aparición de campos adicionales
						personalizados por contrato y cliente para recoger información
						adicional necesaria para gestionar las asistencias de un cliente
						desde la aplicación AMA. Posibles valores de los campos de
						atributos variables pueden ser: matrícula, bastidor, marca,
						modelo, tarjeta verde, vehículo inmovilizado, fax, contacto de
						negocios, descripción de daños, segundo apellido, motivo de la
						llamada, hora preferente para contactar, agente asignado…</xsd:documentation>
        </xsd:annotation>
        <xsd:sequence>
          <xsd:element minOccurs="0" name="etiqueta" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Etiqueta XML del atributo</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="valor" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Valor del atributo</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
        </xsd:sequence>
      </xsd:complexType>
      <xsd:complexType name="AtributosFijosActualizarAsistencia">
        <xsd:annotation>
          <xsd:documentation>Objeto de negocio que representa
						parámetros fijos que se utilizan para actualizar una asistencia.
						Estos parámetros están prefijados y son comunes para todas las
						asistencias.</xsd:documentation>
        </xsd:annotation>
        <xsd:sequence>
          <xsd:element minOccurs="0" name="AMA_ASSIST">
            <xsd:annotation>
              <xsd:documentation>Código de asistencia de AMA</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:long">
                <xsd:minExclusive value="0"/>
                <xsd:maxExclusive value="99999999999"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="ACTION">
            <xsd:annotation>
              <xsd:documentation>Indica si se trata de una modificación,
								una cancelación o una respuesta.

								Podrá tener los valores:
								0 – Modificación
								1 – Cancelación
								2 – Respuesta
								3 – Notificar Expediente Ajeno</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:int">
                <xsd:minInclusive value="0"/>
                <xsd:maxInclusive value="3"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="COMMENTS">
            <xsd:annotation>
              <xsd:documentation>Código de texto libre donde el cliente
								indicará los motivos que propician la generación del mensaje.
								Sólo será obligatorio
								cuando el valor de la acción sea 0, 1 ó 2.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="0"/>
                <xsd:maxLength value="600"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
          <xsd:element minOccurs="0" name="MSG_CLIENT">
            <xsd:annotation>
              <xsd:documentation>Mensaje del cliente.</xsd:documentation>
            </xsd:annotation>
            <xsd:simpleType>
              <xsd:restriction base="xsd:string">
                <xsd:minLength value="1"/>
                <xsd:maxLength value="30"/>
              </xsd:restriction>
            </xsd:simpleType>
          </xsd:element>
        </xsd:sequence>
      </xsd:complexType>
    </xsd:schema>
    <xsd:schema attributeFormDefault="unqualified" elementFormDefault="unqualified" targetNamespace="http://TRON21Connector" xmlns:bons0="http://TRON21Connector">
      <xsd:complexType name="ErrorParam">
        <xsd:sequence>
          <xsd:element minOccurs="1" name="clave" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Nombre del campo a propagar</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="1" name="valor" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Valor del campo a propagar</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
        </xsd:sequence>
      </xsd:complexType>
      <xsd:complexType name="ERRORS">
        <xsd:sequence>
          <xsd:element minOccurs="0" name="codigo" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>El codigo de error, segun el sistema que lo
								ha originado.</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="msg" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>El mensaje descriptivo de error, segun el
								sistema que lo ha originado</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="component" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Componente que genero el error</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="rootcase" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>RootCause de la excepcion</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element maxOccurs="unbounded" minOccurs="0" name="info" type="bons0:ErrorParam">
            <xsd:annotation>
              <xsd:documentation>Informacion adicional en formato
								clave/valor proporcionada por el sistema final y que sea util
								para el procesamiento del mensaje en el cliente del servicio</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
        </xsd:sequence>
      </xsd:complexType>
      <xsd:complexType name="ERROR_ENV">
        <xsd:annotation>
          <xsd:documentation>Objeto que maneja los errores del mensaje
						soap.</xsd:documentation>
        </xsd:annotation>
        <xsd:sequence>
          <xsd:element maxOccurs="unbounded" minOccurs="0" name="ERRORS" type="bons0:ERRORS">
            <xsd:annotation>
              <xsd:documentation>Estructura con los detalles de los
								errores enviados por el componente que los originó en el sistema
								final.</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="codigo" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>El código del error</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="mensaje" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Mensaje descriptivo del error</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="tipo" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Tipo de error, puede tomar los valores:
								fatal, técnico y lógico.</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="timestamp" type="xsd:dateTime">
            <xsd:annotation>
              <xsd:documentation>Fecha y hora a la que se recibió el error</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="contexto" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Contexto en el que se produce el error</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="excepcion" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Detalle de la excepcion</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="componente" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Componente que recibe el error y que
								lo propagara</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
          <xsd:element minOccurs="0" name="aplicacion" type="xsd:string">
            <xsd:annotation>
              <xsd:documentation>Nombre de la aplicacion que genero el
								error.</xsd:documentation>
            </xsd:annotation>
          </xsd:element>
        </xsd:sequence>
      </xsd:complexType>
    </xsd:schema>
  </wsdl:types>
  <wsdl:message name="actualizarAsistencia_msfActualizarAsistenciaMsg">
