  <wsdl:portType name="IGestionarAsistencias">
    <wsdl:documentation>Interfaz de servicio que agrupa las
			operaciones relacionadas con la gestión de asistencias genéricas AMA</wsdl:documentation>
    <wsdl:operation name="crearAsistencia">
      <wsdl:documentation>Operación que permite crear una nueva
				asistencia AMA</wsdl:documentation>
      <wsdl:input message="tns:crearAsistenciaRequestMsg" name="crearAsistenciaRequest"></wsdl:input>
      <wsdl:output message="tns:crearAsistenciaResponseMsg" name="crearAsistenciaResponse"></wsdl:output>
      <wsdl:fault message="tns:crearAsistencia_msfCrearAsistenciaMsg" name="msfCrearAsistencia"></wsdl:fault>
    </wsdl:operation>
    <wsdl:operation name="actualizarAsistencia">
      <wsdl:documentation>Operación que permite modificar una
				asistencia AMA</wsdl:documentation>
      <wsdl:input message="tns:actualizarAsistenciaRequestMsg" name="actualizarAsistenciaRequest"></wsdl:input>
      <wsdl:output message="tns:actualizarAsistenciaResponseMsg" name="actualizarAsistenciaResponse"></wsdl:output>
      <wsdl:fault message="tns:actualizarAsistencia_msfActualizarAsistenciaMsg" name="msfActualizarAsistencia"></wsdl:fault>
